const express = require("express");
const router = express.Router();

const auth = require("../middlewares/authMiddleware");
const role = require("../middlewares/roleMiddleware");
const {
  createPublisherType,
  getPublisherTypes,
  deactivatePublisherType
} = require("../controllers/adminPublisherTypeController");

// Admin only
router.post("/create", auth, role("admin"), createPublisherType);
router.get("/", auth, role("admin"), getPublisherTypes);
router.patch("/deactivate/:id", auth, role("admin"), deactivatePublisherType);

module.exports = router;
